import React from 'react'
import { Link } from 'react-router-dom'

function Navbar() {
  return (
    <div>
        <Link href='/'><button className='button'>Home</button></Link><br/>
        <Link href='/hr'><button className='button'>Human Resource</button></Link><br/>
        <Link href='/finance'><button className='button'>Finance</button></Link><br/>
        <Link href='/inventory'><button className='button'>Inventory</button></Link>
    </div>
  )
}

export default Navbar
